  flex: 1;
  background-color: white;
  justify-content: center;
  align-items: center;
`

const Title = styled.Text`
  font-size: 20px;
  font-family: 'AkkuratTT-Light.ttf';
`


const HomePage = () => {
    const [fontLoaded] = useFonts({
        'AkkuratTT-Light': require('../assets/fonts/AkkuratTT-Light.ttf'),
    });

    return (
        <Container>

            <Title>Hej</Title>
        </Container>
    )

}

export default HomePage;
